sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
    var req= inputs.req;
    if(typeof req =='object'){
        req=req;
    }
    else{
        req=JSON.parse(req);
    }
    var age=calculateAge(req.dob);

    var key=req.productId+"_"+req.variantId+"_"+req.premium+"_"+req.pt+"_"+req.ppt+"_"+req.paymentFrequency+"_"+age;
    var gr=new GlideRecord('x_rptp_smartinte_0_integration_cache_table');
    gr.addQuery('key',key);
    gr.query();
    if(gr.next()){
        outputs.response=gr.response;
    }
    else
    outputs.response=false;

})(inputs, outputs);
 function calculateAge(dob) {
  var convertedDate=dob.split("/").reverse().join("/"); // output: 2022/07/24
return  (new x_rptp_smartinte_0.moment().diff(convertedDate, 'years')).toString().split(".")[0];
}

